import React from 'react';

const Rating = ({title, max, step}) => {
	// 将用户输入的答案存到sessionStorage
	return (
		<fieldset>
			<legend><h3>{title}</h3></legend>
			<input type="range" min={0} max={max} step={step}/>
		</fieldset>
	);
};

export default Rating;
